import React from 'react';
import './css/UI.css'

function List(){
  var title ="Morning Activity";
  var desc ="Take a jogg and drink coffee.";
  return(
    <div class="list">
    <div className="taskTitle">{title}</div>
    <br></br>
    <div className="taskDesc">{desc}</div>
    </div>
  );
}
export default List;
